import './App.css';
import { BrowserRouter as Route, Switch } from 'react-router-dom';
import Home from './Pages/Home.js'
import Gallery from './Pages/Gallery.js'
import PaymentOption from './Pages/PaymentOption'
import MenuAppBar from './Components/ProfileBar';
import ThankYou from './Pages/ThankYou';
import YouTubeIcon from '@mui/icons-material/YouTube';
import TwitterIcon from '@mui/icons-material/Twitter';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import FacebookIcon from '@mui/icons-material/Facebook';
import CopyrightIcon from '@mui/icons-material/Copyright';
import ButtonLink from './Components/Link';
import ButtonLink1 from './Footer/Important';
import ButtonLink2 from './Footer/Privacy';
import ButtonLink3 from './Footer/Cookie';
import ButtonLink4 from './Footer/DLT';
import ButtonLink5 from './Footer/Contact';


function App() {
  return (
    <div className="App">
      {/* Header (Navigation Bar) */}
      <header className="App-header">
      <MenuAppBar/>
      </header>
      
      {/* Router - Pages */}
          <Switch>
            <Route path={process.env.PUBLIC_URL + '/'} exact > <Home/> </Route>
            <Route path={process.env.PUBLIC_URL + '/home'} > <Home/> </Route>
            <Route path={process.env.PUBLIC_URL + '/gallery'}  > <Gallery/> </Route>
            <Route path={process.env.PUBLIC_URL + '/PaymentOption'}  > <PaymentOption/> </Route>
            <Route path={process.env.PUBLIC_URL + '/ThankYou'}  > <ThankYou/> </Route>
          </Switch>

      <footer className="App-footer">
        <FacebookIcon/>
        <LinkedInIcon/>
        <TwitterIcon />
        <YouTubeIcon />
        <br/>
        <ButtonLink1/>
        <br/>
        <ButtonLink2/>
        <br/>
        <ButtonLink3/>
        <br/>
        <ButtonLink4/>
        <br/>
        <ButtonLink5/>
        <br/>
        <p>
        <CopyrightIcon/> 2021 Airtel India. All Rights Reserved.
        </p> 
      </footer>
    </div>
  );
  }

export default App;
